const muddamaalData = [
  {
    id: 1,
    crimeNo: '101/2022',
    crimeDate: '2022-01-15',
    muddamaalNo: 'MD001',
    category: 'Weapons',
    quantity: 5,
    status: 'In Police Custody',
    custodyDate: '2022-01-16',
  },
  {
    id: 2,
    crimeNo: '102/2022',
    crimeDate: '2022-02-10',
    muddamaalNo: 'MD002',
    category: 'Drugs',
    quantity: 10,
    status: 'Disposed',
    custodyDate: '2022-02-11',
  },
  {
    id: 3,
    crimeNo: '103/2022',
    crimeDate: '2022-03-05',
    muddamaalNo: 'MD003',
    category: 'Cash',
    quantity: 500000,
    status: 'Other',
    custodyDate: '2022-03-06',
  },
  // Add more records as needed
];

export default {
  get: (url) => {
    if (url === '/api/muddamaal') {
      return Promise.resolve({ data: muddamaalData });
    }
    return Promise.reject(new Error('Not found'));
  },
};
